export const POSTNUMMER_REGISTRY: Map<string, PostnummerEntry> = new Map(REGISTRY_DATA);

// Pre-compute reverse lookup: poststed -> postnummer entries
const POSTSTED_INDEX = new Map<string, PostnummerEntry[]>();
for (const entry of POSTNUMMER_REGISTRY.values()) {
  const key = entry.poststed.toUpperCase();
  let list = POSTSTED_INDEX.get(key);
  if (!list) {
    list = [];
    POSTSTED_INDEX.set(key, list);
  }
  list.push(entry);
}

/**
 * Look up postal code entry by postnummer
 */
export function lookupPostnummer(postnummer: string): PostnummerEntry | undefined {
  const padded = postnummer.replace(/\D/g, '').padStart(4, '0');
  return POSTNUMMER_REGISTRY.get(padded);
}

/**
 * Find all postal code entries matching a city/poststed name (case-insensitive)
 */
export function lookupPoststed(poststed: string): PostnummerEntry[] {
  const normalized = poststed.trim().toUpperCase();
  return POSTSTED_INDEX.get(normalized) || [];
}

/**
 * Check if a postal code exists in the registry
 */
export function isValidPostnummer(postnummer: string): boolean {
  const padded = postnummer.replace(/\D/g, '').padStart(4, '0');
  return POSTNUMMER_REGISTRY.has(padded);
}

/**
 * Get the city name for a postal code (convenience function)
 */
export function getPoststedForPostnummer(postnummer: string): string | undefined {
  return lookupPostnummer(postnummer)?.poststed;
}

/**
 * Get all postal codes for a municipality (kommune)
 * @param kommune - Municipality name (case-insensitive)
 * @returns Array of postal code entries for that municipality
 */
export function getPostnummerForKommune(kommune: string): PostnummerEntry[] {
  const searchTerm = kommune.trim().toUpperCase();
  const results: PostnummerEntry[] = [];

  for (const entry of POSTNUMMER_REGISTRY.values()) {
    if (entry.kommune.toUpperCase() === searchTerm) {
      results.push(entry);
    }
  }

  return results;
}
